              src={require("../images/chevron.png")}
            ></img>
          </div>
          <img
            onClick={this.leftArrow}
            className="leftArrow"
            src={require("../images/arrow_back.png")}
          ></img>
          <img
            onClick={this.rightArrow}
            className="rightArrow"
            onClick={this.rightArrow}
            src={require("../images/arrow_forward.png")}
          ></img>
        </React.Fragment>
      );
    } else {
      return (
        <div>
          <Media query="(max-width: 848px)">
            {(matches) =>
              matches ? (
                <p>The document is less than 848 px wide.</p>
              ) : (
                <p>The document is at least 848 px wide.</p>
              )
            }
          </Media>
          <Media query="(max-width: 548px)">
            {(matches) =>
              matches ? (
                <p>The document is less than 548 px wide.</p>
              ) : (
                <p>The document is at least 548 px wide.</p>
              )
            }
          </Media>
        </div>
      );
    }
  }
}
